import { Row, Col, Button } from 'antd';
import arsenaltop from './arsenaletop.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <h1>Noemi Romano</h1>
      <Row>
      <Col span={12}><Button type="primary">Button</Button></Col>
      <Col span={12}><img src={arsenaletop} alt='arsenale-top'/></Col>
    </Row>

      </div>
    );
  }
}

export default App;
